import logo from './logo.svg';
import './App.css';
import CategorySummary from './components/CategorySummary'; //importering av komponenten 
import TransactionList from './components/TransactionList'; //importering av komponenten
console.log("App loaded");

function App() {
  return (
    <div className="App">
      <header>
              <h1>  
              Budget Mananger
              </h1>
          </header>
          <main>
              {console.log("Rendering CategorySummary")}
              <CategorySummary />
              <TransactionList categoryId={1} />
          </main>
    </div>
  );
}

export default App;
